import styled from "styled-components";
import React,{useEffect} from 'react'
import {connect} from 'react-redux'
import {getUsers} from '../../store/actions/getempolyee'



const LayoutDashboard = styled.div`
  flex: 7 1 0%;
  background-color: rgba(255,214,107,1);
  display: flex;
  flex-direction: column;

`;

interface TableTimeProps {
    employeesData: any
}

function TableTime({
    employeesData
}: TableTimeProps) {

    const [data, setData] = React.useState([]); 
    useEffect(() => {
        getUsers();
    }, [])

    useEffect(() => { 
        setData([]);       
    },[employeesData])
      return (
            <LayoutDashboard className="h-screen">
                <div className="md:px-10 mt-8 py-8 w-full ">
                    <div className="shadow overflow-hidden rounded border-b border-gray-200">
                        <table className="min-w-full bg-white">
                            <thead className="bg-gray-800 text-white">
                                <tr>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">No</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">Name</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">Check-In</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">Check-Out</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">#Note</th>
                                </tr>
                            </thead>
                            <tbody className="text-gray-700">
                                <tr >
                                    <td className=" text-left py-3 px-4">1</td>
                                    <td className=" text-left py-3 px-4">Smith</td>
                                    <td className="text-left py-3 px-4">09:56</td>
                                    <td className="text-left py-3 px-4">17:09</td>
                                    <td className="text-left py-3 px-4">-</td>
                                </tr>
                                <tr className="bg-gray-100">
                                    <td className=" text-left py-3 px-4">2</td>
                                    <td className=" text-left py-3 px-4">Johnson</td>
                                    <td className="text-left py-3 px-4">09:57</td>
                                    <td className="text-left py-3 px-4">-</td>
                                    <td className="text-left py-3 px-4">-</td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                </div>
            </LayoutDashboard>
        )
    }
 const mapStateToProps =  (state: { employees: any; }) =>{
        return{
            employeesData : state.employees
        }
    }

export default connect(mapStateToProps)(TableTime);
